// load navbar
document.addEventListener("DOMContentLoaded", function(event) {

    const showNavbar = (toggleId, navId, bodyId, headerId) =>{
        const toggle = document.getElementById(toggleId),
        nav = document.getElementById(navId),
        bodypd = document.getElementById(bodyId),
        headerpd = document.getElementById(headerId)
        
        // Validate that all variables exist
        if(toggle && nav && bodypd && headerpd){
            toggle.addEventListener('click', ()=>{
                // show navbar
                nav.classList.toggle('show')
                // change icon
                toggle.classList.toggle('bx-x')
                // add padding to body
                bodypd.classList.toggle('body-pd')
                // add padding to header
                headerpd.classList.toggle('body-pd')
            })
        }
    }
    showNavbar('header-toggle','nav-bar','body-pd','header')
    
    // link active
    const linkColor = document.querySelectorAll('.nav_link')
    function colorLink(){
        if(linkColor){
            linkColor.forEach(l=> l.classList.remove('active'))
            this.classList.add('active')
        }
    }
    linkColor.forEach(l=> l.addEventListener('click', colorLink))
    
    // DOM LOADED & READY //
    $(document).ready(function(){

        // set max input date
        setMaxDateInput()

        // load tom-select search
        new TomSelect("#userlist",{
            create: false,
            sortField: {
                field: "text",
                direction: "asc"
            }
        })

        var userFNText;
        var userAddText;
        // get elements
        testHistory = $("#testHistory")
        testHistoryHeader = $("#testHistoryHeader")
        testHistoryTable = $("#testHistoryTable")
        testHistoryBody = $("#testHistoryBody")
        
        userlist = $("#userlist")
        testID = $('#testID')
        testDate = $("#testDate")
        method = $("#method")
        facility = $("#facility")
        testResult = $("#testResult")
        testBtn = $('#testBtn')
        positive = $('#positive')
        negative = $('#negative')
        userName = $("#userName")
        userAddress = $("#userAddress")
        pdfButton = $("#saveAsPDF")

        // userlist on change
        userlist.change(function(){

            if (userlist.val() != null && userlist.val() != "") {

                $.ajax({
                    type: 'GET',
                    data: {userid: $('#userlist').val()},
                    url: '/userTestInfo/getUserTestHistory',
                    contentType: "application/x-www-form-urlencoded; charset=UTF-8",
                    success:
                    function(data){

                        userName.html(data.userFullName)
                        userFNText = data.userFullName;
                        userAddress.html(data.userFullAddress)
                        userAddText = data.userFullAddress;

                        console.log(data.userCovidTests)

                        // clear test history body, hide header
                        testHistoryBody.empty()
                        testHistoryHeader.attr('hidden', true)

                        // disable add test btn, clear panel
                        testID.val("")
                        testDate.val("")
                        method.val("")
                        facility.val("")
                        $('input[type=radio][name=testResult]').prop('checked', false)

                        testBtn.attr('disabled', true)
                        testBtn.css("background-color", "#708978")


                        if (data.userCovidTests.length != 0) {
                            testHistoryTable.attr('hidden', false)

                            data.userCovidTests.sort(function (a, b) {
                                var dateA = new Date(a.date), dateB = new Date(b.date)
                                return dateB - dateA
                            });

                            for (var i = 0; i < data.userCovidTests.length; i++) {

                                // create elements
                                var tr = $("<tr>")
                                var tdID = $("<td>")
                                var tdDate = $("<td>")
                                var tdFacility = $("<td>")
                                var tdMethod = $("<td>")
                                var tdResult = $("<td>")

                                // set data
                                tdID.html(data.userCovidTests[i].testID)
                                tdDate.html(data.userCovidTests[i].date)
                                tdFacility.html(data.userCovidTests[i].facility)
                                tdMethod.html(data.userCovidTests[i].method)
                                tdResult.html(data.userCovidTests[i].result)

                                // append tds to tr
                                tr.append(tdID)
                                tr.append(tdDate)
                                tr.append(tdFacility)
                                tr.append(tdMethod)
                                tr.append(tdResult)

                                // append tr to table body
                                testHistoryBody.append(tr)

                                // show download as pdf button
                                pdfButton.css("background-color", "#2A8348")
                                pdfButton.attr('hidden', false)

                            }
                        }

                        else {
                            testHistoryHeader.html("USER HAS NO RECORDED TESTS YET.")
                            testHistoryHeader.attr('hidden', false)
                            testHistoryTable.attr('hidden', true)
                                
                            // hide download as pdf button
                            pdfButton.attr('hidden', true)
                        }

                        // input listeners
                        testID.on("keyup", function() {
                            console.log("HELLO!!")
                            if (inputChecker()) {
                                testBtn.attr('disabled', false)
                                testBtn.css("background-color", "#2A8348")
                            } else {
                                testBtn.attr('disabled', true)
                                testBtn.css("background-color", "#708978")   
                            }
                        })

                        testDate.on("change", function() {
                            console.log("hello")
                            if (inputChecker()) {
                                testBtn.attr('disabled', false)
                                testBtn.css("background-color", "#2A8348")
                            } else {
                                testBtn.attr('disabled', true)
                                testBtn.css("background-color", "#708978")   
                            }
                        })

                        method.on("change", function() {
                            if (inputChecker()) {
                                testBtn.attr('disabled', false)
                                testBtn.css("background-color", "#2A8348")
                            } else {
                                testBtn.attr('disabled', true)
                                testBtn.css("background-color", "#708978")   
                            }
                        })

                        facility.on("keyup", function() {
                            if (inputChecker()) {
                                testBtn.attr('disabled', false)
                                testBtn.css("background-color", "#2A8348")
                            } else {
                                testBtn.attr('disabled', true)
                                testBtn.css("background-color", "#708978")   
                            }
                        })

                        $('input[type=radio][name=testResult]').change(function() {
                            if (inputChecker()) {
                                testBtn.attr('disabled', false)
                                testBtn.css("background-color", "#2A8348")
                            } else {
                                testBtn.attr('disabled', true)
                                testBtn.css("background-color", "#708978")   
                            }
                        })
    
                        // allow editable
                        testID.attr('disabled', false)        
                        testDate.attr('disabled', false)
                        method.attr('disabled', false)
                        facility.attr('disabled', false)         
                        testResult.attr('disabled', false)
                        positive.attr('disabled', false)
                        negative.attr('disabled', false)

                        // when any inputs change, if they're all have input, eneable button
                        function inputChecker() { 
                            console.log("entered input checker") // && testResult.val()
                            if(testID.val() && testDate.val() && method.val() && facility.val() && atLeastOneRadio()) {
                                console.log("input check: true")
                                return true
                            }
                            else {
                                console.log("input check: false")
                                return false
                            }
                        }

                        // radio input checker
                        function atLeastOneRadio() { 
                            console.log($('input[type=radio]:checked').size() > 0)
                            return ($('input[type=radio]:checked').size() > 0)
                        }

                        console.log("ajax finished.")
                    }
                })
            }
        })

        //

        var userTestHistoryPDF = new jsPDF()
        var imgData;

        function imageData(){
            imgData = "data:image/png;base64,"
        }

        imageData();

        pdfButton.click(function(){

           

            userTestHistoryPDF.addImage(imgData, 'PNG', 0, 0, 220, 25);

            userTestHistoryPDF.autoTable({
                head: [[' ', '']],
                body: [['Name: ', userFNText], ['Address: ', userAddText]], 
                columnStyles: { 0: { fontStyle: 'bold', fontSize: 8}, 1: {fontSize: 8} },
                startY: 25,
                theme: 'plain'
            })

         
           userTestHistoryPDF.autoTable({
                 html: '#testHistoryTable', 
                 styles: {fontSize: 10}, 
                 theme: 'grid',
                  startY: 50,
                });
            
            
           
         
            userTestHistoryPDF.save("UserTesting.pdf");
           
    
        })

        function setMaxDateInput() {
            var today = new Date()
            var dd = today.getDate()
            var mm = today.getMonth() + 1
            var yyyy = today.getFullYear()
            
            if (dd < 10) {
               dd = '0' + dd
            }
            
            if (mm < 10) {
               mm = '0' + mm
            }
        
            today = yyyy + '-' + mm + '-' + dd
            console.log(today)
        
            document.getElementById("testDate").max = today
        }



    })
})